import './Expenses.css';
import ExpenseItem from './ExpenseItem';

const Expenses = (props) => {
    return (
        <div className='shell'>
            <ExpenseItem 
                title={props[0].title} 
                date={props[0].date} 
                amount={props[0].amount}
            />
            <ExpenseItem 
                title={props[1].title} 
                date={props[1].date} 
                amount={props[1].amount}
            />
            <ExpenseItem 
                title={props[2].title} 
                date={props[2].date} 
                amount={props[2].amount}
            />
      </div>
    );
};

export default Expenses
